import React from "react";
import "./Grid.css";
import {myGrid} from "./calc.js";

class Grid extends React.Component {
   constructor(props){
      super(props);
      this.state = {
        boxes: myGrid
      }
   }



  render() {
    return (
        <div className="myGrid">
          {this.state.boxes.map((items) => {
            return (
              <div className="gridLine" key={items.id}>
                {items.map((subItem) => {
                  return (
                    <div className="gridBox"  key={subItem.id}>
                      {subItem.i}
                    </div>
                  );
                })}
              </div>
            );
          })}
        </div>
    );
  }
}

export default Grid;
